import React, { useState } from 'react'
import { useEffect } from 'react';
import ProductService from '../services/ProductService';

const TableRow = ({cart}) => {
  const[product, setProduct] = useState({});
  useEffect(() => {
    const fetchProduct = (productId) =>{
        try{
            const response = ProductService.getProductById(productId);
            setProduct(response.data);
        }catch(error)
        {
            console.log(error);
        }
    }
   fetchProduct(cart.productId)
  }, [])
  
  return (
    <>
      <tr>
        <td>cart.id</td>
        <td>product.name</td>
        <td>product.price</td>
        <td>cart.quantity</td>
      </tr>
    </>
  )
}

export default TableRow
